import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './page/Home/Home';
import About from './page/about/About';
import Article from './page/blog/Article';
import Course from './page/course/Course';
import Login from './page/login/Login';
import Panel from './page/panel/Panel';

function App() {
 return(
  <BrowserRouter>
  <Routes>
    <Route path='/' element={<Home/>}/>
    <Route path='/about' element={<About/>}/>
    <Route path='/Article/*' element={<Article/>}>
    <Route path='php' element={<h2>php article</h2>}/>
          <Route path='js' element={<h2>java script article</h2>}/>
          <Route path='react' element={<h2>react article</h2>}/>
    </Route>
    <Route path='/course/:courseId' element={<Course/>}/>
    <Route path='/panel' element={<Panel/>}/>
    <Route path='/login' element={<Login/>}/>
  </Routes>
  </BrowserRouter>
 )
}

export default App;
